module.exports = "\n<body class=\"site-body\">\n  <header id=\"header\" class=\"site-header\" role=\"navigation\">\n    <div class=\"container-fluid\">\n      <div class=\"menu-wrapper\">\n        <div id=\"nav-bar-wrap\" class=\"col-md-14 nav-col\">\n          <nav id=\"nav-bar-content\" class=\"navbar navbar-expand-lg navbar-dark bg-dark custom-navbar\">\n            <div class=\"register-link\">\n              <div class=\"register-btn\">\n                <div class=\"btn smoothscroll new-btn\">\n                  <a href=\"/signup\" class=\"label\" style=\"color: black;\">SIGN UP</a>\n                </div>\n                <div class=\"btn btn-default geni-btn\">\n                  <a href=\"/signin\" class=\"label\"style=\"color: black;\">SIGN IN</a>\n                </div>\n              </div>\n              <ul>\n                <li><a href=\"/\">HOME</a></li>\n                <li><a href=\"/about-page\">ABOUT </a></li>\n                <li><a href=\"/cargo-owner\">CARGO OWNERS</a></li>\n                <li><a href=\"/\" rel=\"home\"><img class=\"d-block\" src=\"assets/frontend/img/img/logo.png\" alt=\"Truckr\"></a></li>\n                <li><a href=\"/transporters\"> TRANSPORTERS</a></li>\n                <li><a href=\"/contact\">CONTACT</a></li>\n                <li><a href=\"/faqs\">FAQs</a></li>\n              </ul>\n            </div>\n          </nav>\n        </div>\n      </div>\n    </div>\n  </header>\n\n  <div id=\"myCarousel\" class=\"carousel slide\" data-ride=\"carousel\">\n    <!-- Wrapper for slides -->\n    <div class=\"carousel-inner\">\n      <div class=\"item active\">\n        <img src=\"assets/frontend/img/img/AboutBanner.jpg\" alt=\"New york\" style=\"width:100%;\">\n      </div>\n      <div class=\"carousel-header \">\n        <div class=\"col-md-9 col-md-push-1 text-center\">\n          <h2 class=\"probootstrap-heading probootstrap-animate\">\n            What is Truckr?</h2>\n        </div>\n      </div>\n    </div>\n\n    <section class=\"probootstrap-section probootstrap \" id=\"features\" data-section=\"features\">\n      <div class=\"container\">\n        <div class=\"row text-center\">\n          <div class=\"col-md-10 col-md-offset-1 probootstrap-section-heading\">\n            <h2 class=\"mb30 text-black probootstrap-heading\" style=\"margin-top: 60px;\">About Truckr</h2>\n            <p>Truckr is giving cargo owners such as manufacturing companies, fast moving consumer goods, distributors, exporteres,\n              importers, freight forwarders the ability to book for any kind of haulage truck online to haul their goods.\n              Truckr also offers cargo owners the luxury of tracking their goods with our accurate tracking technology and\n              can also message and call the truck drivers all on the platform. Truckr lives at the intersection of technology\n              and logistics.\n            </p>\n          </div>\n        </div>\n      </div>\n    </section>\n\n    <section class=\"probootstrap-section\" id=\"features\" data-section=\"features\">\n      <div class=\"container\">\n        <div class=\"row\">\n          <div class=\"col-md-3 text-center\">\n            <div class=\"probootstrap-service-item probootstrap-animate\" data-animate-effect=\"fadeIn\">\n              <img class=\"img-feature\" src=\"assets/frontend/img/img/insurance.png\">\n              <h2>Insurance Coverage</h2>\n              <p>Get your cargo insured with our insurance partners. You are guaranteed security for your goods in the eventuality\n                of loss or damage.\n              </p>\n            </div>\n          </div>\n          <div class=\"col-md-3 text-center\">\n            <div class=\"probootstrap-service-item probootstrap-animate\" data-animate-effect=\"fadeIn\">\n              <img class=\"img-feature\" src=\"assets/frontend/img/img/Notification.png\">\n              <h2>Accountability</h2>\n              <p>We treat our customers' cargo like our own, taking complete accountability of the movement of the goods.</p>\n\n            </div>\n          </div>\n          <div class=\"col-md-3 text-center\">\n            <div class=\"probootstrap-service-item probootstrap-animate\" data-animate-effect=\"fadeIn\">\n              <img class=\"img-feature\" src=\"assets/frontend/img/img/laptop.png\">\n              <h2>Increased Efficiency</h2>\n              <p>Reduce seizure & detention charges, avoid follow-up cost on lost cargo, by acting upon foreseeable delays.\n              </p>\n            </div>\n          </div>\n          <div class=\"col-md-3 text-center\">\n            <div class=\"probootstrap-service-item probootstrap-animate\" data-animate-effect=\"fadeIn\">\n              <img class=\"img-feature\" src=\"assets/frontend/img/img/Icons2.png\">\n              <h2>Technology Powered</h2>\n              <p>Truckr's technology allows you to really focus on your business by reducing the time, money and effort spent\n                in coordinating the complexities of logistics.\n              </p>\n            </div>\n          </div>\n        </div>\n      </div>\n    </section>\n    <!-- END row -->\n    <section class=\"quote\">\n      <div class=\"quote-paragraphs\">\n        <img class=\"quote-image\" src=\"assets/frontend/img/img/tires.png\">\n        <p class=\"single-paragraph\">\n          “Book on demand trucks online with an intelligent, simple and user-friendly interface.\"\n        </p>\n      </div>\n    </section>\n\n    <section class=\"probootstrap-section probootstrap \" id=\"features\" data-section=\"features\">\n      <div class=\"container\">\n        <div class=\"row text-center\">\n          <div class=\"col-md-10 col-md-offset-1 probootstrap-section-heading\">\n            <h2 class=\"mb50 text-black probootstrap-heading\">Team</h2>\n            <p>Founded by a 3 tech entrepreneurs from Ghana, Nigeria and South Africa. Truckr understands the challenges of\n              local trucking and is dedicated to creating new solutions with technology. The diversity of our team and their\n              ideas is what gives Truckr the edge in an industry that still relies heavily on phone calls, email and excel\n              sheets.\n            </p>\n          </div>\n        </div>\n      </div>\n    </section>\n    <section class=\" probootsrap-section\">\n      <div class=\"container\">\n        <div class=\"col-md-4 probootstrap-animate text-center\">\n          <div class=\"blog-inner\">\n            <a href=\"#\"><img class=\"img-responsive\" src=\"assets/frontend/img/img/Cjay.png\" alt=\"Blog\"></a>\n            <div class=\"desc\">\n              <h3><a href=\"#\">Caryl Joshua Akonor </a></h3>\n              <h4>\n                Co-founder, Chief Product Officer\n                <br></h4>\n\n              <p>\n                As the C.P.O, I am passionate about the product and our customers. My responsibilities includes of the Product Vision, Strategy,\n                Design, Development, Innovation and Marketing. I manage the day-to-day execution of all product activities\n                for the purpose of meeting the business’s goals.\n              </p>\n              <a href=\"https://www.linkedin.com/in/carylakonor/\" target=\"_blank\"> \n                <img class=\"img-responsive linkedin\" src=\"assets/frontend/img/img/link.png\">\n              </a>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-md-4  probootstrap-animate text-center\">\n          <div class=\"blog-inner\">\n            <a href=\"#\"><img class=\"img-responsive\" src=\"assets/frontend/img/img/tshepo.png\" alt=\"Blog\"></a>\n            <div class=\"desc\">\n              <h3><a href=\"#\">Tshepo Morabane</a></h3>\n              <h4>\n                Co-founder, Chief Executive Officer\n                <br></h4>\n\n              <p>As the C.E.O of Truckr, I drive the passion of the company by taking custody of our Vision, Mission and Objectives.\n                I have 5 years experience as a financial consultant. As a Sociable Capitalist, I am passionate about Local\n                Economic Development. We are building a tech solution that seeks to minimize the financial implications on\n                the Road Freight Logistics Industry.\n\n              </p>\n              <a href=\"https://www.linkedin.com/in/tshepomorabane/\" target=\"_blank\"> \n                <img class=\"img-responsive linkedin\" src=\"assets/frontend/img/img/link.png\"></a>\n            </div>\n          </div>\n        </div>\n        <div class=\"col-md-4 probootstrap-animate text-center\">\n          <div class=\"blog-inner\">\n            <a href=\"#\"><img class=\"img-responsive\" src=\"assets/frontend/img/img/amaka.png\" alt=\"Blog\"></a>\n            <div class=\"desc\">\n              <h3><a href=\"#\">Chiamaka Nwosu</a></h3>\n              <h4>\n                Co-founder, Chief Technology Officer\n                <br></h4>\n              <p>\n                As the C.T.O of Truckr, my goal is to build a world class scalable solution that seeks to improve the operations of road\n                freight by providing a more efficient, reliable and cheaper platform to book, track and manage your fleet.\n                At Truckr we aim to automate mundane and redundant task to improve efficiency in road freight by harnessing\n                the power of technology. I have 3 years experience as a software developer and 4 years experience as a project\n                manager.\n              </p>\n              <a href=\"https://www.linkedin.com/in/chiamaka-nwosu/\" target=\"_blank\"> \n                <img class=\"img-responsive linkedin\" src=\"assets/frontend/img/img/link.png\"></a>\n            </div>\n          </div>\n        </div>\n      </div>\n    </section>\n\n    <!-- END section -->\n\n    <section class=\"get-app-section\">\n      <div class=\"get-app\">\n        <img class=\"get-app-image\" src=\"assets/frontend/img/img/GetAppBackground.jpg\" class=\"img-responsive\" width=\"100%\" alt=\"image\">\n        <div class=\"mobile-app-all\">\n          <div class=\" mobile-app-about probootstrap-animate\">\n            <h1 style=\" font-weight:  700;\">\n              Move your next cargo\n              <br>with Truckr</h1>\n            <div class=\" \">\n              <br>\n              <p class=\"probootstrap-animate\" style=\"/* margin: 0 auto; */text-align: center; padding: 47px;\">\n                <a href=\"/signup\" target=\"_blank\" class=\"btn btn-default smoothscroll new-btn\" role=\"button\">Get Started</a>\n              </p>\n            </div>\n          </div>\n\n        </div>\n      </div>\n    </section>\n\n    <footer class=\"footer\" style=\"background-image: url(assets/frontend/img/img/footerbg.jpg);\" role=\"contentinfo\">\n      <div class=\"container\">\n        <div class=\"row\">\n          <div class=\"footer-content\">\n            <div class=\"contact\" id=\"contact\">\n              <img class=\"d-block\" src=\"assets/frontend/img/img/truckrFooterLogo.png\" alt=\"Truckr\">\n              <ul>\n                <li><a>No. 20 Aluguntugui Street,</a></li>\n                <li><a>East Legon, Accra, Ghana</a></li>\n                <li><a>Tel: +233 206 703 723</a></li>\n                <li><a href=\"info@truckrtech.com\">info@truckrtech.com</a></li>\n              </ul>\n            </div>\n            <div class=\"product-footer\">\n              <h4 class=\"footer-link-header\">Product</h4>\n              <ul>\n                <li><a href=\"#\">Cargo Owner</a></li>\n                <li><a href=\"#\">Transporter</a></li>\n                <li><a href=\"#\">Features</a></li>\n                <li><a href=\"#\">FAQs</a></li>\n              </ul>\n            </div>\n            <div class=\"product-footer\">\n              <h4 class=\"footer-link-header\">Company</h4>\n              <ul>\n                <li><a href=\"#\">About</a></li>\n                <li><a href=\"#\">Contact</a></li>\n                <li><a href=\"#\">Help</a></li>\n              </ul>\n            </div>\n            <div class=\"product-footer\">\n              <h4 class=\"footer-link-header\">Website</h4>\n              <ul>\n                <li><a href=\"#\">Terms</a></li>\n                <li><a href=\"#\">Privacy</a></li>\n              </ul>\n            </div>\n            <div class=\"product-footer\">\n              <h4 class=\"footer-link-header\">Social Media</h4>\n              <ul>\n                <li><a href=\"#\">Follow us on facebook</a></li>\n                <li><a href=\"#\">Follow us on twitter</a></li>\n              </ul>\n            </div>\n          </div>\n        </div>\n      </div>\n      <div class=\"footer-copyright\">\n        <div class=\"copyright\">\n          <p>©2018 <span>Truckr Technologies All rights reserved.</span></p>\n        </div>\n      </div>\n    </footer>\n  </div>\n\n</body>\n"

